import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const RoleScreen = ({ navigation }) => {
  return (
    <View>
      <Text>RoleScreen</Text>
    </View>
  )
}

export default RoleScreen

const styles = StyleSheet.create({})
